// src/pages/CreateCarPage.js
import React from 'react';
import CarForm from '../components/CarForm';

function CreateCarPage() {
  return (
    <div>
      <h1>Create a New Car</h1>
      <CarForm isEdit={false} />
    </div>
  );
}

export default CreateCarPage;
